import React from 'react'

import './card.component.scss'

export default function Card(props) {
    const { cardClickCallback } = props;
    const { users } = props

    const { gender, name, email } = users

    const handleOnCardClick = (activeUser) => {
        cardClickCallback(activeUser);
        console.log(users)
    }
    return (
        <div className='card-container' style={{}}
            onClick={handleOnCardClick(activeUser)}>
            <p className='p-gender'>{gender}</p>
            <p className='p-name'>{name.title} {name.first} {name.last}</p>
            <p className='p-email'>{email}</p>
        </div>
    )
}
